import React from 'react';
import VideoItem from './VideoItem';

const VideoList = ({ videos, onUpVote, onDownVote, onDelete }) => {
  return (
    <div className="video-list">
      {videos.map((video) => (
        <VideoItem
          key={video.id}
          video={video}
          onUpVote={onUpVote}
          onDownVote={onDownVote}
          onDelete={onDelete}
        />
      ))}
    </div>
  );
};

export default VideoList;
